import 'package:equatable/equatable.dart';

class Odds extends Equatable {
  final String? msg;

  const Odds({this.msg});

  factory Odds.(
      Map<String, dynamic> json) {
    return Odds(
      msg: json['msg'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'msg': msg,
    };
  }

  @override
  List<Object?> get props => [msg];
}
